// 语音功能请求
const voice = () => {
	// 获取用户发送的内容
    let val = $('input').val();
	// 判断发送的信息不能为空
    if (!val) { return alert('内容不能为空'); }
	// 发送请求
    $.get('https://v.api.aa1.cn/api/api-xiaoai/talk.php?', { msg: val, type: 'json' }, (res) => {
        var row = JSON.parse(res);
		// 播放音频
        $('.audio').attr('src', row.meta.music.musicUrl);
    })
	// 输入框清空
    $('input').val('');
}

// 唤醒app判断
const awaken = () => {
	if (val == '打开微信' || val == '帮我打开微信' || val ==  '微信' ) { location.href = 'weixin://' } 
	if (val == '打开QQ' || val == '帮我打开QQ' || val == '打开qq' || val == '帮我打开qq' || val == 'qq' || val == 'QQ' ) { location.href = 'mqq://' } 
	if (val == '打开京东' || val == '帮我打开京东' || val == '京东' ) { location.href = 'openApp.jdMobile://' } 
	if (val == '打开淘宝' || val == '帮我打开淘宝' || val == '淘宝' ) { location.href = 'taobao://' } 
	if (val == '打开微博' || val == '帮我打开微博' || val == '微博' ) { location.href = 'iosamap://' } 
	if (val == '打开抖音' || val == '帮我打开抖音' || val == '抖音' ) { location.href = 'douyin://' }
	if (val == '打开微信扫码' || val == '帮我打开微信扫码' || val == '打开微信支付' || val == '帮我打开微支付' ) { location.href = 'weixin://scanqrcode' }
}

